import React from 'react';
import ReactDOM from 'react-dom';

export default class TaskCreate extends React.Component{
    render(){
        return(
            <div className = "taskCreateWindow">
                <body className = 'taskCreateTitle' top = '20%'>
                    New Task
                </body>
                <body className='taskCreateTxt'>
                    Date:
                </body>
                <body className='taskCreateTxt'>
                    Time:
                </body>
                <body className='taskCreateTxt'>
                    Priority:
                </body>
                <body className='taskCreateTxt'>
                    Title:
                </body>
                <body className='taskCreateTxt'>
                    Description:
                </body>
                <body className='taskCreateTxt'>
                    Category:
                </body>
            </div>
        );
    }
}
console.log("hello");
